import servicesList from '../../assets/categoriesinfo.json';

function PurchaseCard() {
  // eslint-disable-next-line no-return-assign
  return (servicesList.map = (service) => (
    <div className="cards_container">
      <section className="containerCard__cardbox">
        <img
          className="containerCard__cardbox--imageBackground"
          src={service.imageService}
          alt={service.nameService}
        />
        <h1 className="containerCard__cardbox--nameService">{service.nameService}</h1>
      </section>
    </div>
  ));
}
export default PurchaseCard;
